webpackJsonp([47050937948703],{1278:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2012-06-17-major-holiday-with-the-wife-and-kids/index.md absPath of file >>> MarkdownRemark",html:"<p>It's not often that the stars align and two big events coincide. Today is Father's day, but it's also our anniversary.</p>\n<p>Today is a big deal since it marks 15 years of being married to the most beautiful, kindest, and most wonderful woman on earth. I can't believe that 15 years can go so fast, but I'm planning on at least another 60 more so we have plenty of chances to celebrate. Still I don't think there are enough years in one lifetime to spend with such an incredible companion.</p>\n<p>Today, being Father's day, also marks an opportunity to celebrate 5 great kids. We love them each individually even managing them collectively is more like crowd control than parenting. I couldn't be happier.</p>",frontmatter:{title:"Major Holiday With the Wife and Kids",date:"June 17, 2012",imageUrl:null,image:null}}},pathContext:{path:"/major-holiday-with-the-wife-and-kids"}}}});
